import React from "react";
import { Container, Row, Col, Button, Navbar, Nav } from "react-bootstrap";

const NavBar = () => {
  return (
    <>
      <Navbar className="navbar" collapseOnSelect expand="lg">
        <Navbar.Brand style={{ display: "flex" }}>
          <h3
            style={{
              color: "white",
            }}
          >
            RASPITAR
          </h3>
          <h3
            style={{
              textDecoration: "underline",
              marginLeft: "10px",
              color: "white",
            }}
          >
            WEB
          </h3>
        </Navbar.Brand>
        <Navbar.Toggle
          aria-controls="responsive-navbar-nav"
          style={{ color: "white" }}
        />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav>
            <Button
              style={{
                marginRight: "10px",
                marginBottom: "10px",
                backgroundColor: "white",
                color: "black",
                fontWeight: "bold",
                fontSize: "18px",
              }}
            >
              Settings
            </Button>
            <Button
              style={{
                marginRight: "10px",
                marginBottom: "10px",
                backgroundColor: "white",
                color: "black",
                fontWeight: "bold",
                fontSize: "18px",
              }}
            >
              Log Out
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </>
  );
};

export default NavBar;
